2.        בא-כוח העורר העלה טענות ביחס לראיות לכאורה. לגישתו מדובר בראיות
נסיבתיות שאינן שוללות אפשרות של זיכוי – לאור גרסתו של העורר הכופר במיוחס לו;
כמו גם לאור עמדתו של הנאשם 3 אשר טען כי הסמים שנמצאו בדירה הם בבעלותו שלו;
ולאור העובדה שהנאשם 1 ולא העורר הוא מי ששכר את הדירה שבה נמצאו הסמים. כן נטען
שתסקיר שירות המבחן הוא חיובי ואף מטעם זה יש מקום להורות על חלופת מעצר.

